def perm_sub(li, used):
    if len(li) == len(used):
        return [deque()]
    k = []
    for i in range(len(li)):
        if i in used:
            continue
        used.add(i)
        sub_list = perm_sub(li, used)
        for sub in sub_list:
            sub.appendleft(li[i])
        k.extend(sub_list)
        used.discard(i)
    return k


def perm_li(li):
    return perm_sub(li, set())


def perm_n(n):
    return perm_sub(list(range(n)), set())


def join_i(li, sep=""):
    return sep.join([str(e) for e in li])


def li2n(li):
    n, base = 0, 1
    for i in range(len(li)-1, -1, -1):
        n += li[i] * base
        base *= 10
    return n


def sli2ili(li):
